function generateRandomHsl() {
	let randomH = Math.round(Math.random() * 360)
	let randomS = Math.round(Math.random() * 100) + 25
	let randomL = Math.round(Math.random() *50 )  + 15
	return `hsl(${randomH}, ${randomS}%, ${randomL}%)`
}

let rp = generateRandomHsl()

function parseHSL(str) {
  var hsl, h, s, l
  hsl = str.replace(/[^\d,]/g, '').split(',')   // strip non digits ('%')  
  h = Number(hsl[0])                            // convert to number
  s = Number(hsl[1])
  l = Number(hsl[2])
  return [h, s, l]                              // return parts
}

function harmonize(color, start, end, interval) {
    const colors = [color]
    const [h, s, l] = parseHSL(color)

    for(let i = start; i <= end; i += interval) {
        const h1 = (h + i) % 360
        const c1 = `hsl(${h1}, ${s}%, ${l}%)`
        colors.push(c1)
    }

    return colors
}

